
--usuń przypadkowo dodanych sprzątaczy
delete from soldier s
where s.id = (	select p.id 
				from personel p 
				left join "role" r on r.id = p.role_id
				where p.id = s.id and r.role_name = 'SPRZĄTACZ' );

-- check
select count(*) 
from soldier s
left join personel p on s.id = p.id 
left join "role" r on r.id = p.role_id
where r.role_name = 'SPRZĄTACZ';

